import Home from "../screen/home/Home";
import Search from "../screen/search/search";
import { Route,  Routes } from "react-router-dom";

function App() {
  return (
    <Routes>
    <Route exact path="/" component={Home} />
    <Route path  ="/search" component={Search} />
    </Routes>
  );
}

export default App;
